    ///         instead of reinvested.
    function simpleHarvest() external view returns (bool);

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            4. NON-CONSTANT FUNCTIONS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /// @notice Gets the rewards from the terminalToken and returns an array of tokens with the amounts harvested.
